# the BruteForce Approach
def brute_force(s:str):
    max_length = 0
    n = len(s)
    for i in range(n):
        sub_string = ""
        for j in range(i ,n):
            sub_string += s[j]
            if len(set(sub_string)) >= len(sub_string):
              max_length = max(max_length,len(sub_string))
    return max_length 


# Time complexity O(n) = n**2
print(brute_force("abcabcbb"))
print(brute_force("bbbbb"))
print(brute_force("pwwkew"))
print(brute_force('"ungfzoihbxifoprwcjzsdxngtacwtjypweuxvegybogsfxqhipbompu"'))
