def optimal_one (s:str):
    n = len(s)
    max_length = 0
    left = 0
    right = 0
    has_set =  set()
    while right < n:
        print(right)
        if  s[right] not  in has_set:
            tem_length = right - left +1
            max_length = max(max_length,tem_length)
            has_set.add(s[right])
            right +=1
        else:
            has_set.remove(s[left])
            left += 1
    return max_length

        
print(optimal_one("abcabcbb"))


def better_one(s:str):
    n = len(s)
    max_length = 0
    current_length = 0
    start = 0
    has_map ={}
    for i in range(n):
        if s[i] in has_map and has_map[s[i]] >= start:
            start =  has_map[s[i]] + 1
            current_length = i - start + 1
        else:
            current_length +=1

        has_map[s[i]]= i
        max_length = max(max_length,current_length)    
    return max_length

print(better_one("abcabcbb"))